import React from "react";
import { HashRouter, Link } from 'react-router-dom';

function Guide() {
    return (
        <div className="MainBox">
            <span className="GuideTextTitle">
                Re:coder 모바일 촬영 화면입니다.
            </span>
            <span className="GuideText">
                PC 시험 준비를 위해 아래 위치한 버튼을 누른 뒤 안내에 따라 주시기 바랍니다.
            </span>
            <div>
                    <HashRouter>
                    <Link to="/Guide2">
                    <button className="GuideButton" >연결 요청</button>
                    </Link>
                    </HashRouter>
                </div>
        </div>
    )
}

export default Guide;
